met de stemmen van Hero Muller, Roos van Waerden en Rinie van de Elzen

Roodkapje, Wolf, Assepoester, Reus en Klein Duimpje komen per ongeluk terecht in het onbekende Winterland. De Sprookjesbosbewoners willen heel graag terug naar huis, maar dan moeten ze eerst vijf kristallen vinden. Tijdens de zoektocht naar de kristallen probeert Heks daar een stokje voor te steken. Ook ontmoeten de Sprookjesvrienden de Winterlandbewoners ijskabouter Kluns, IJsdraak en IJsfakir. Gaat het de Sprookjesbosbewoners lukken om weer terug te komen in het Sprookjesbos?




